        System.out.println(isMatchDP("aa", "a*")); //true
        System.out.println(isMatchDP("ab", "?*")); //true
        System.out.println(isMatchDP("aab", "c*a*b")); //false
        System.out.println(isMatchDP("a", "aa")); //false
        System.out.println(isMatchDP("babaaababaabababbbbbbaabaabbabababbaababbaaabbbaaab", "***bba**a*bbba**aab**b")); //false
        System.out.println(isMatchDP("c","*?*"));  //true
        System.out.println(isMatchDP("a","ab*"));  //false
        System.out.println(isMatchDP("mississippi", "m*si*"));  //true
        System.out.println(isMatchDP("acacac", "a*a*c"));  //true

        System.out.println("\n=================\n");

        System.out.println(isMatchDP2("","*"));  //true
        System.out.println(isMatchDP2("","***"));  //true
        System.out.println(isMatchDP2("a","a*"));  //true
        System.out.println(isMatchDP2("b", "?*?"));  //false
        System.out.println(isMatchDP2("aa","a"));  //false
        System.out.println(isMatchDP2("aa","aa")); //true
        System.out.println(isMatchDP2("aaa","aa")); //false
        System.out.println(isMatchDP2("aa", "*")); //true
        System.out.println(isMatchDP2("aa", "a*")); //true
        System.out.println(isMatchDP2("ab", "?*")); //true
        System.out.println(isMatchDP2("aab", "c*a*b")); //false
        System.out.println(isMatchDP2("a", "aa")); //false
        System.out.println(isMatchDP2("babaaababaabababbbbbbaabaabbabababbaababbaaabbbaaab", "***bba**a*bbba**aab**b")); //false
        System.out.println(isMatchDP2("c","*?*"));  //true
        System.out.println(isMatchDP2("a","ab*"));  //false
        System.out.println(isMatchDP2("", "**"));
        //false
        System.out.println(isMatchDP2("mississippi", "m*si*"));  //true
        System.out.println(isMatchDP2("acacac", "a*a*c"));  //true


        System.out.println("\n=================\n");

        System.out.println(isMatchGreedy("","*"));  //true
        System.out.println(isMatchGreedy("","***"));  //true
        System.out.println(isMatchGreedy("a","a*"));  //true
        System.out.println(isMatchGreedy("b", "?*?"));  //false
        System.out.println(isMatchGreedy("aa","a"));  //false
        System.out.println(isMatchGreedy("aa","aa")); //true
        System.out.println(isMatchGreedy("aaa","aa")); //false
        System.out.println(isMatchGreedy("aa", "*")); //true
        System.out.println(isMatchGreedy("aa", "a*")); //true
        System.out.println(isMatchGreedy("ab", "?*")); //true
